import React from 'react';

function Story() {
  return (
    <div>
      <div className='pt-44 sm:pt-40' >  
      </div>
      <div className='h-[120vh] sm:h-[120vh] bg-black text-white overflow-hidden'>
      <div className=' flex items-start justify-evenly h-full py-10 px-5'>
        <div className=' mr-36 sm:mr-[60rem] pt-5 sm:pt-36 z-10'>
        <h1 className='text-6xl sm:text-[10rem]'>Our</h1>
        <h1 className='text-6xl sm:text-[10rem]'>Story</h1>
        <p className='text-1xl pt-10'>The story behind Exo Ape is one of </p>  
        <p className='text-1xl pt-10'>exploration, creativity and curiosity.</p>    
        </div>
        <div className='absolute h-full pl-20 sm:pl-[20rem] pt-5'>
          <video autoPlay loop muted   src="https://www.exoape.com/video/video-6.mp4"></video>
        </div>
      </div>
    </div>
      </div>
  );
}

export default Story;
